import './App.css';
import Boton from './components/Boton';
import Link from './components/Link';
import Foto from './components/Foto';

function App() {
  return (
    <div>
      <Link class = "nombre" link = "#" texto = "Ian Levin"/>
      <Foto img="/img/binker.svg" alt="imagen"/>
    </div>
  );
}

export default App;
